import { createStore,applyMiddleware } from 'redux';
import store from ''

class App extends Component {
  render() {
    return (
      <Provider store={store}>
        <div className="App">
          <Postform />
          <Posts />

        </div>
      </Provider>
    );
  }
}

export default App;
